import React from 'react';

const FollowerCards = (props) => {
    console.log('rendering users...')
    return (
        <div>
            {props.followers.map(follower =>(
                <div key={follower.username} className='follower'>
                    <img src={follower.data.avatar_url} alt={follower.data.name}/>
                    <div>
                        <h2>{follower.data.name}</h2>
                        <h2>{follower.data.login}</h2>
                        <h3>Location: {follower.data.location}</h3>
                        <h3>Profile:</h3>
                    </div>

                </div>
            ))}
        </div>
    )

}

export default FollowerCards;
